def merge_the_tools(s, l):
    s_list = list(s)
    num_sequences = int(len(s)/l)
    sequences = []
    seen_letters = {}
    output = []
    for i in range(num_sequences):
        sequences.append(s_list[i*l:i*(l)+l])
        seen_letters[i] = {}
        this_line = ""
        for j in range(len(sequences[i])):
            letter = sequences[i][j]
            if(letter not in seen_letters[i]):
                this_line+=letter
                seen_letters[i][letter] = True
        print(this_line)
        output.append(this_line)


    return output


